import React, {useState} from 'react';
import './login.css';
import logo from '../../f2.jfif'
import api from '../api/index'
import Login from './Login/Login'




class MyWrapper extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      isLoogedIn:false,
      userName: '',
    }
    
  
  }


  render() {
    return (
      <div>
      
      <Login></Login>
      </div>
    )
  }
}

export default MyWrapper;
